async function uploadAudio(uri) {
    const formData = new FormData();
    formData.append("file", {
      uri, // Local URI to the recorded file
      type: "audio/x-caf", // MIME type for CAF audio files
      name: "audiofile.caf", // File name with CAF extension
    });

    try {
      const serverUrl = server + "api/openai/" + "audioFileSTT";

      const response = await axios.post(serverUrl, formData, {
        headers: {
          "Content-Type": "multipart/form-data",
        },
      });

      let STTtext = response.data.text

      console.log("STT", STTtext);
    } catch (error) {
      console.error("Error translating to text:", error);
    }
  }

